  const userList = useAppSelector((state: any) => state.users);
  return (
    <div className="App">

      <div className='app-top-bar'>
        {/* <Modal/> */}
        <h1 className='title'>Поиск</h1>
        <SearchUser />

        <div className='sort'>
          <p>Все</p>
        {userList.map((i:any) => {
          return <p>{ i.department}</p>
     })}
        </div>

      </div>
      <UserList/>


    </div>
  );
}

export default App;
